import React from 'react';
import Navbar from '../components/Navbar';
import HeroImg from "../components/HeroImg";
import Footer from "../components/Footer";


const Project = () => {
  return (
    <div>
        <Navbar/>
        <HeroImg/>
        <Footer/>
    </div>
  )
}

export default Project
